pub enum Event {

    /// A keyboard key was pressed.
    KeyPressed {
        /// The key identifier
        key_code: KeyCode,
        /// The state of the modifier keys
        modifiers: Modifiers,
    },

    /// A keyboard key was released.
    KeyReleased {
        /// The key identifier
        key_code: KeyCode,
        /// The state of the modifier keys
        modifiers: Modifiers,
    },

    /// A unicode character was received.
    CharacterReceived(char),

    /// The keyboard modifiers have changed.
    ModifiersChanged(Modifiers),
}

pub enum Button {

    /// The left mouse button.
    Left,

    /// The right mouse button.
    Right,

    /// The middle (wheel) button.
    Middle,

    /// Some other button.
    Other(u8),
}

pub enum Event {

    /// The mouse cursor entered the window.
    CursorEntered,

    /// The mouse cursor left the window.
    CursorLeft,

    /// The mouse cursor was moved
    CursorMoved {
        /// The new position of the mouse cursor
        position: Point,
    },

    /// A mouse button was pressed.
    ButtonPressed(Button),

    /// A mouse button was released.
    ButtonReleased(Button),

    /// The mouse wheel was scrolled.
    WheelScrolled {
        /// The scroll movement.
        delta: ScrollDelta,
    },
}

pub enum ScrollDelta {

    /// A line-based scroll movement
    Lines {
        /// The number of horizontal lines scrolled
        x: f32,
        /// The number of vertical lines scrolled
        y: f32,
    },

    /// A pixel-based scroll movement
    Pixels {
        /// The number of horizontal pixels scrolled
        x: f32,
        /// The number of vertical pixels scrolled
        y: f32,
    },
}

pub enum Align {

    /// Align at the start of the axis.
    Start,

    /// Align at the center of the axis.
    Center,

    /// Align at the end of the axis.
    End,
}

pub enum HorizontalAlignment {

    /// Align left
    Left,

    /// Horizontally centered
    Center,

    /// Align right
    Right,
}

pub enum VerticalAlignment {

    /// Align top
    Top,

    /// Vertically centered
    Center,

    /// Align bottom
    Bottom,
}

pub enum Background {

    /// A solid color
    Color(Color),
}

pub enum Font {

    /// The default font.
    ///
    /// This is normally a font configured in a renderer or loaded from the
    /// system.
    Default,

    /// An external font.
    External {
        /// The name of the external font
        name: &'static str,
        /// The bytes of the external font
        bytes: &'static [u8],
    },
}

pub enum Length {

    /// Fill all the remaining space
    Fill,

    /// Fill a portion of the remaining space relative to other elements.
    ///
    /// Let's say we have two elements: one with `FillPortion(2)` and one with
    /// `FillPortion(3)`. The first will get 2 portions of the available space,
    /// while the second one would get 3.
    ///
    /// `Length::Fill` is equivalent to `Length::FillPortion(1)`.
    FillPortion(u16),

    /// Fill the least amount of space
    Shrink,

    /// Fill a fixed amount of space
    Units(u16),
}
